import logo from './logo.svg';
import './App.css';
import {Button, Layout, Typography, Avatar} from "antd";
const { Header, Footer, Sider , Content} = Layout;
const { Title } = Typography;

function App() {
  return (
    <div className="App">
      <Layout>
      <Header>
        <Avatar icon="user" />
        <Title style={{color:'white'}} level={3}>AJID Mada</Title>

      </Header>
     <Layout>
     <Sider style={{background:"purple"}}>Sider</Sider>
      <Content>Content</Content>
     <Footer style={{color:'purle'}}>Footer</Footer>
      </Layout>
      </Layout>
     <Button type="primary">Envoyer</Button>
     <br></br>
     <hr></hr>
     <Button type="danger">Cancel</Button>
    </div>
  );
}

export default App;
